import axios from "axios";

const a = "3422d7fc774c45373d2fc05c9da83a2d1a8b6295b0cfe340b7bab15749ee8a12b91dc853dc7a685c0b41c72cb680bb50aacba75ff07f94856024983890e45a103c0ec07191fd510b27d1f2bdba8f9b519c77e4d7ba55236c81e97366b3b78ac64c2ed0f8c8dc3377b5d86ff04c888c9b1a912aa0e4d0616c2d9a5ba2acaa921d"

const params = {
    headers: {
        Authorization: "bearer " + process.env.REACT_APP_STRIPE_DEV_APP_KEY,
    },
};

export const fetchDataFromApi = async (url) => {
    console.log(params);
    try {
        const { data } = await axios.get(
            a + url,
            params
        );
        return data;
    } catch (err) {
        console.log(err);
        return err;
    }
};
